import React, { useState, useEffect } from 'react';
import api from '../services/api';
import { Typography, Button, List, ListItem, ListItemText, Paper, TextField, Dialog, DialogActions, DialogContent, DialogTitle, Grid, Box } from '@mui/material';
import EventIcon from '@mui/icons-material/Event';

const AppointmentsScreen = () => {
  const [appointments, setAppointments] = useState([]);
  const [open, setOpen] = useState(false);
  const [newAppointment, setNewAppointment] = useState({ date: '', time: '', doctor: '', reason: '' });

  useEffect(() => {
    fetchAppointments();
  }, []);

  const fetchAppointments = async () => {
    try {
      const response = await api.getAppointments();
      setAppointments(response.data);
    } catch (error) {
      console.error('Error fetching appointments:', error);
    }
  };

  const handleClickOpen = () => {
    setOpen(true);
  };

  const handleClose = () => {
    setOpen(false);
  };

  const handleChange = (e) => {
    setNewAppointment({ ...newAppointment, [e.target.name]: e.target.value });
  };

  const handleSubmit = async () => {
    try {
      console.log('Submitting appointment:', newAppointment);
      const response = await api.createAppointment(newAppointment);
      console.log('Appointment created:', response.data);
      setOpen(false);
      fetchAppointments();
    } catch (error) {
      console.error('Error creating appointment:', error.response ? error.response.data : error.message);
    }
  };

  return (
    <Box sx={{ flexGrow: 1, p: 3 }}>
      <Typography variant="h4" gutterBottom>
        Appointments
      </Typography>
      <Grid container spacing={3}>
        <Grid item xs={12}>
          <Paper elevation={3} sx={{ p: 3, height: '300px', overflow: 'auto' }}>
            <Box sx={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', mb: 2 }}>
              <Typography variant="h6">Upcoming Appointments</Typography>
              <Button variant="contained" onClick={handleClickOpen} startIcon={<EventIcon />}>
                Add Appointment
              </Button>
            </Box>
            {appointments.length > 0 ? (
              <List>
                {appointments.map((appointment) => (
                  <ListItem key={appointment.id}>
                    <ListItemText
                      primary={`Dr. ${appointment.doctor}`}
                      secondary={`${appointment.date} at ${appointment.time} - ${appointment.reason}`}
                    />
                  </ListItem>
                ))}
              </List>
            ) : (
              <Typography>No upcoming appointments.</Typography>
            )}
          </Paper>
        </Grid>
      </Grid>
      <Dialog open={open} onClose={handleClose}>
        <DialogTitle>Add New Appointment</DialogTitle>
        <DialogContent>
          <TextField
            autoFocus
            margin="dense"
            name="date"
            label="Date"
            type="date"
            fullWidth
            variant="outlined"
            InputLabelProps={{ shrink: true }}
            onChange={handleChange}
          />
          <TextField
            margin="dense"
            name="time"
            label="Time"
            type="time"
            fullWidth
            variant="outlined"
            InputLabelProps={{ shrink: true }}
            onChange={handleChange}
          />
          <TextField
            margin="dense"
            name="doctor"
            label="Doctor"
            type="text"
            fullWidth
            variant="outlined"
            onChange={handleChange}
          />
          <TextField
            margin="dense"
            name="reason"
            label="Reason"
            type="text"
            fullWidth
            variant="outlined"
            onChange={handleChange}
          />
        </DialogContent>
        <DialogActions>
          <Button onClick={handleClose}>Cancel</Button>
          <Button onClick={handleSubmit} variant="contained">Add</Button>
        </DialogActions>
      </Dialog>
    </Box>
  );
};

export default AppointmentsScreen;
